import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>Type a number on the whiteboard and click enter.</p>
        <p>[Whiteboard here]</p>
        <button onClick={this.handleClick}>Click Me</button>
      </header>
    </div>
  );
}

export default App;
